import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from "react-router-dom";
export default function Menu(){
    return(
        <>
            <Link to='/CalculIMC'>
                <button className="btn btn-light w-100 font-weight-bold text-primary">CalculIMC</button>
            </Link>
            <Link to='/Historique'>
                <button className="btn btn-light w-100 font-weight-bold text-primary">Historique</button>
            </Link>
        </>
    )
}
